 localStorage.clear();
 nav("/");
}

return(

<nav className="navbar navbar-expand navbar-dark bg-dark shadow">

<div className="container">

<Link className="navbar-brand fw-bold" to="/dashboard"> <span className="fw-bold fs-4"></span>"
â˜• BeanTalk
</Link>

<div>

{user && <Link className="btn btn-outline-light me-2" to="/ask">Ask</Link>}

{!user && <Link className="btn btn-outline-light me-2" to="/">Login</Link>}

{!user && <Link className="btn btn-warning me-2" to="/register">Register</Link>}

{user && <button className="btn btn-danger" onClick={logout}>Logout</button>}

</div>

</div>

</nav>

);

